import { Box } from "@mui/material"
import Nav from './components/Nav';
import Bio from './components/Bio';
import Gallery from './components/Gallery';

const App = () => { 
  return (
    <Box>
    <div className="container">
    <Nav />
    <Bio />
    <Gallery />
   </div> 
   </Box>
  )
}

export default App;
